              autoStart: true,
              loop: true,
              deleteSpeed: 50,
            }}
          />
        </h4>
        {/* <div className="header__img">
          <img src={background} alt="background" />
        </div> */}
        {/* <CTA /> */}
        {/* <a href="#contact" className="scroll__down">
          Scroll Down
        </a> */}
        <Intro />
        <CTA />
        <Contact />
        <Socials />
      </div>
    </header>
  );
};

export default Header;
